window.bookSummaryJSON = "<p>Losses mount and deadly new threats converge in this next action-packed tale of the Arcana Chronicles by #1 <i>New York Times</i> best seller Kresley Cole. </p> <p>When the battle is done.... </p> <p>The Emperor unleashed hell and annihilated an army, jeopardizing the future of mankind - but Circe struck back. The epic clash between them devastates the Arcana world and nearly kills Evie, separating her from her allies. </p> <p>And all hope is lost.... </p> <p>With Aric missing and no sign that Jack and Selena escaped Richter's reach, Evie turns more and more to the darkness lurking inside her. Two Arcana emerge as game changers: one who could be her salvation, the other her worst nightmare. </p> <p>Vengeance becomes everything. </p> <p>To take on Richter, Evie must reunite with Death and mend their broken bond. But as she learns more about her role in the future - and her chilling past - will she become a monster like the Emperor? Or can Evie and her allies rise up from Richter's ashes, stronger than ever before? </p>"; 
